import{_ as a,c as r,o,ag as t}from"./chunks/framework.CshwDK8X.js";const u=JSON.parse('{"title":"Default Fixtures","description":"","frontmatter":{},"headers":[],"relativePath":"using-ramp4/fixture-overview.md","filePath":"using-ramp4/fixture-overview.md"}'),i={name:"using-ramp4/fixture-overview.md"};function h(s,e,n,d,l,c){return o(),r("div",null,e[0]||(e[0]=[t('<h1 id="default-fixtures" tabindex="-1">Default Fixtures <a class="header-anchor" href="#default-fixtures" aria-label="Permalink to &quot;Default Fixtures&quot;">​</a></h1><p>The following fixtures are included in the default setup. Any special interfaces they support is also noted; this information is relevant when replacing defaults fixtures, as discussed in the Examples section below.</p><h3 id="appbar" tabindex="-1">Appbar <a class="header-anchor" href="#appbar" aria-label="Permalink to &quot;Appbar&quot;">​</a></h3><p>The <code>appbar</code> provides a means to open and track panels, or run custom commands. See the <a href="./fixtures/appbar.html">Appbar docs</a> for more information.</p><h3 id="basemap" tabindex="-1">Basemap <a class="header-anchor" href="#basemap" aria-label="Permalink to &quot;Basemap&quot;">​</a></h3><p>The <code>basemap</code> provides an interface to change the basemap layers of the map.</p><h3 id="crosshairs" tabindex="-1">Crosshairs <a class="header-anchor" href="#crosshairs" aria-label="Permalink to &quot;Crosshairs&quot;">​</a></h3><p>The <code>crosshairs</code> displays crosshairs at the centre of the map when keyboard navigation is active.</p><h3 id="details" tabindex="-1">Details <a class="header-anchor" href="#details" aria-label="Permalink to &quot;Details&quot;">​</a></h3><p>The <code>details</code> provides an interface to view information about a feature / voxel, and to see a collection of identify results. See the <a href="./fixtures/details.html">Details docs</a> for more information.</p><h3 id="geosearch" tabindex="-1">Geosearch <a class="header-anchor" href="#geosearch" aria-label="Permalink to &quot;Geosearch&quot;">​</a></h3><p>The <code>geosearch</code> is a utility that allows one to search for geographic names and zoom to the results. See the <a href="./fixtures/geosearch.html">Geosearch docs</a> for more information.</p><h3 id="grid" tabindex="-1">Grid <a class="header-anchor" href="#grid" aria-label="Permalink to &quot;Grid&quot;">​</a></h3><p>The <code>grid</code> provides a tabular view of attributes for a feature class. See the <a href="./fixtures/grid.html">Grid docs</a> for more information.</p><h3 id="help" tabindex="-1">Help <a class="header-anchor" href="#help" aria-label="Permalink to &quot;Help&quot;">​</a></h3><p>The <code>help</code> provides a means to display user help for the application.</p><h3 id="hilight" tabindex="-1">Hilight <a class="header-anchor" href="#hilight" aria-label="Permalink to &quot;Hilight&quot;">​</a></h3><p>The <code>hilight</code> enables specific features on the map to become visually prominent.</p><h3 id="keyboardnav" tabindex="-1">Keyboardnav <a class="header-anchor" href="#keyboardnav" aria-label="Permalink to &quot;Keyboardnav&quot;">​</a></h3><p>The <code>keyboardnav</code> fixture exposes the keyboard command chain and help overlay. See the <a href="./fixtures/keyboardnav.html">Keyboard Navigation docs</a> for more information.</p><h3 id="layer-reorder" tabindex="-1">Layer Reorder <a class="header-anchor" href="#layer-reorder" aria-label="Permalink to &quot;Layer Reorder&quot;">​</a></h3><p>The <code>layer-reorder</code> provides an interface to reorder the stack of layers on the map.</p><h3 id="legend" tabindex="-1">Legend <a class="header-anchor" href="#legend" aria-label="Permalink to &quot;Legend&quot;">​</a></h3><p>The <code>legend</code> provides an interactive listing of the layers and other data on the map. See the <a href="./fixtures/legend.html">Legend docs</a> for more information.</p><h3 id="mapnav" tabindex="-1">Mapnav <a class="header-anchor" href="#mapnav" aria-label="Permalink to &quot;Mapnav&quot;">​</a></h3><p>The <code>mapnav</code> provides controls to help navigate the map.</p><h3 id="northarrow" tabindex="-1">Northarrow <a class="header-anchor" href="#northarrow" aria-label="Permalink to &quot;Northarrow&quot;">​</a></h3><p>The <code>northarrow</code> provides an arrow pointing to or a symbol marking the geographic north pole.</p><h3 id="panguard" tabindex="-1">Panguard <a class="header-anchor" href="#panguard" aria-label="Permalink to &quot;Panguard&quot;">​</a></h3><p>The <code>panguard</code> can prevent the map from panning on a single touch-swipe, requiring a double-touch.</p><h3 id="overviewmap" tabindex="-1">Overviewmap <a class="header-anchor" href="#overviewmap" aria-label="Permalink to &quot;Overviewmap&quot;">​</a></h3><p>The <code>overviewmap</code> provides a smaller map displaying the current map extent within the context of a larger area.</p><h3 id="scrollguard" tabindex="-1">Scrollguard <a class="header-anchor" href="#scrollguard" aria-label="Permalink to &quot;Scrollguard&quot;">​</a></h3><p>The <code>scrollguard</code> can prevent the map from zooming when a user scroll-wheels on the map. Useful for maps embedded in pages that a user would scroll through.</p><h3 id="settings" tabindex="-1">Settings <a class="header-anchor" href="#settings" aria-label="Permalink to &quot;Settings&quot;">​</a></h3><p>The <code>settings</code> allow you to make live modifications to a layer on the map. See the <a href="./fixtures/layer-settings.html">Layer Settings docs</a> for more information.</p><h3 id="wizard" tabindex="-1">Wizard <a class="header-anchor" href="#wizard" aria-label="Permalink to &quot;Wizard&quot;">​</a></h3><p>The <code>wizard</code> provides an interface to allow users to add layers to the map.</p>',38)]))}const m=a(i,[["render",h]]);export{u as __pageData,m as default};
